int division(int32_t dividend, int32_t non_inv_divisor, int scale, int MASK, int M){
    int32_t posd = (non_inv_divisor<0)?-non_inv_divisor:non_inv_divisor;
    //Find number of leading zeros
    int32_t clz = __builtin_clz(posd);
    clz = 8*sizeof(posd) - clz;

    //Find n such that initial divisor is of the form 2^n * 1.y1y2...yk
    int32_t n = clz - 1 - scale;

    //posd == divd == 1.y1y2...yk
    int32_t divd = posd = (n>0)?posd>>n:posd<<(-n);
    // cout<<n<<endl;

    int mask = MASK;
    mask <<= (scale - M);

    //divd == y1y2y3...ymym+1...yn, where ym+1...yk are all zeros
    divd = divd & mask;

    //index = y1y2---ym
    int32_t index = divd >> (scale-M);
    
    int32_t i1 = a1[scale][index];
    int32_t i0 = a0[scale][index];
    // cout<<i0<<","<<i1<<","<<float(posd)/(1<<scale)<<endl;
    
    //divisor == -a1y + a0
    int divisor = (non_inv_divisor<0?-1:1)* ( int32_t( ( int64_t(-i1)*int64_t(posd) )>>scale ) + i0);
    // divisor = (int64_t(divisor)*(int64_t(int64_t(1<<(scale+1)) - (int64_t)(int64_t(divisor)*int64_t(non_inv_divisor))>>scale)))>>scale;

    //dividend == dividend/2^n
    dividend = n>0?(dividend>>n):(dividend<<(-n));

    // multiply inverted divisor and dividend 
    int64_t interme = int64_t(divisor)* int64_t(dividend);
    int32_t ans = interme>>scale;

    return ans;
}
